import {React, useState} from 'react'
import { useAuth } from '../auth'
const LogIn = () => {
    const [user, setUser] = useState("")
    const handleLogin = () => {
        useAuth()
    }
    return (
        <div>
            <label>
                Username: {' '}
                <input type="text" onChange={(e) => setUser(e.target.value)} />
            </label>
            <button onClick={handleLogin}>LogIn</button>
        </div>
    )
}

export default LogIn
